import styles from './Perfil.module.css'

import { BiHelpCircle } from "react-icons/bi";
import API_BASE_URL from '../ApiConfig';
import { useState, useEffect, useContext  } from 'react'
import { AuthContext } from '../../AuthContext';
import axios from '../../axiosConfig';
import jwt_decode from 'jwt-decode';
import Loading from '../layout/Loading';
import { useFormik } from 'formik';
import * as Yup from 'yup';
import Select from '../form/Select'

import jsPDF from 'jspdf';
import html2canvas from 'html2canvas';
import 'jspdf-autotable';

function Perfil() {

    const { authenticated, setAuthenticated } = useContext(AuthContext);
    const [userId, setUserId] = useState(null); // Define the state for the user ID
    const [evaluationData, setEvaluationData] = useState(null);
    const [resultados, setResultados] = useState([]);

/* ------------------ pegando id do access token ----------------*/
    useEffect(() => {
        const access_token2 = localStorage.getItem("access_token");
        if (access_token2) {
          setAuthenticated(true);
          // Decode the token
          const decodedToken = jwt_decode(access_token2);
          const decode = JSON.stringify(decodedToken);
          // Check if the user is a gestor
          const idDoUsuarioLogado = decodedToken.user_id;
          setUserId(idDoUsuarioLogado);
        } else {
          setAuthenticated(false);
        }
      }, [authenticated]); 

      


      const downloadPdfDocumentWithText = (evaluationData) => {
        const doc = new jsPDF();

        // Adicionar imagem (logo da empresa)
        const base64Logo = "data:image/png;base64,"; 

        const originalWidth = 310;
        const originalHeight = 250;

        // Tamanho desejado da imagem mantendo a proporção
        const desiredWidth = 30;
        const aspectRatio = originalHeight / originalWidth;
        const desiredHeight = desiredWidth * aspectRatio;

        // Posição x calculada para centralizar a imagem
        const pageWidth = doc.internal.pageSize.getWidth();
        const centerX = (pageWidth - desiredWidth) / 2;

        // Adicionar imagem com proporção correta e centralizada
        doc.addImage(base64Logo, 'PNG', centerX, 10, desiredWidth, desiredHeight);

        console.log("entrou no download")
        console.log(evaluationData)
        // Adicionar frases
        const ano = evaluationData.ano

        doc.setFontSize(12);
        doc.text(`Avaliação referente ao período ${ano-1} - ${ano}`, 105, 40, { align: 'center' });
        
        const getAvaliado = () => {
          if (evaluationData.avaliacao_da_chefia.length > 0) {
            return evaluationData.avaliacao_da_chefia[0].avaliado;
          } else if (evaluationData.avaliacao_da_equipe.length > 0) {
            return evaluationData.avaliacao_da_equipe[0].avaliado;
          } else if (evaluationData.auto_avaliacoes.length > 0) {
            return evaluationData.auto_avaliacoes[0].avaliado;
          } else {
            return 'N/A';
          }
        };
        const nomeAvaliado = getAvaliado();
        doc.text(`Avaliado: ${nomeAvaliado}`, 105, 46, { align: 'center' });
      
        // Cabeçalhos da tabela
        const head = [['Avaliador', 'Cooperação', 'Iniciativa', 'Pontualidade', 'Eficiência', 'Responsabilidade', 'Média']];
      
        let body = [];
      
        // Seções de avaliação
        const sections = [
          { title: 'Autoavaliação', data: evaluationData.auto_avaliacoes },
          { title: 'Avaliação da Chefia', data: evaluationData.avaliacao_da_chefia },
          { title: 'Avaliação da Equipe', data: evaluationData.avaliacao_da_equipe }
        ];
      
        sections.forEach(section => {
          // Adicionar cabeçalho da seção independentemente de haver dados
          body.push([{ content: section.title, colSpan: 7, styles: { halign: 'center', fillColor: [211, 211, 211] } }]);
          if (section.data.length > 0) {
            // Adicionar dados da seção
            section.data.forEach(evaluation => {
              body.push([
                evaluation.nome_avaliador, 
                evaluation.coop, 
                evaluation.iniciativa, 
                evaluation.pontualidade, 
                evaluation.eficiencia, 
                evaluation.responsabilidade, 
                evaluation.media
              ]);
            });
          } else {
            // Adicionar linha informando que a avaliação não foi feita
            body.push([{ content: "Essa avaliação ainda não foi feita", colSpan: 7, styles: { halign: 'center' } }]);
          }
        });
      
        // Adicionar Assiduidade e Nota Geral
        if (evaluationData.avaliacao_da_chefia.length > 0) {
          body.push(
            [{ content: 'Assiduidade', colSpan: 6, styles: { halign: 'right', fillColor: [211, 211, 211] } }, evaluationData.avaliacao_da_chefia[0].assiduidade.toString()],        
          );
        } else {
          // Adicionar linha informando que a avaliação não foi feita
          body.push([{ content: 'Assiduidade', colSpan: 6, styles: { halign: 'right', fillColor: [211, 211, 211] } }, "Sem Nota"]);
        }
      
        body.push(     
          [{ content: 'Nota Final', colSpan: 6, styles: { halign: 'right', fillColor: [211, 211, 211] } }, evaluationData.nota_geral.toFixed(2)],
        );
      
        // Adicionar tabela ao documento
        doc.autoTable({
          head: head,
          body: body,
          theme: 'grid',
          startY: 54, // Ajusta a posição inicial da tabela para baixo do cabeçalho e frases
          didDrawPage: function(data) {
            // Configurações adicionais podem ser feitas aqui
          },
        });

        // Adicionar tabela do acordo de desempenho
        const acordoDesempenhoHead = [['Acordo de Desempenho']];
        const acordoDesempenhoBody = [
            [{ content: `Avaliador: ${evaluationData.acordo_desempenho.nome_avaliador}`, colSpan: 1 }],
            [{ content: `Período de Início: ${formatDate(evaluationData.acordo_desempenho.periodo_inicio)}`, colSpan: 1 }],
            [{ content: `Período de Fim: ${formatDate(evaluationData.acordo_desempenho.periodo_fim)}`, colSpan: 1 }]
        ];

        evaluationData.acordo_desempenho.atividades.forEach((atividade, index) => {
            acordoDesempenhoBody.push([{ content: `Descrição da Atividade: ${atividade.descricao_atividade}`, colSpan: 1 }]);
            acordoDesempenhoBody.push([{ content: `Desempenho Esperado: ${atividade.desempenho_esperado}`, colSpan: 1 }]);
        });

        // Adicionar tabela do acordo de desempenho ao documento
        doc.autoTable({
            head: acordoDesempenhoHead,
            body: acordoDesempenhoBody,
            theme: 'grid',
            startY: doc.autoTable.previous.finalY + 10,
            styles: { fillColor: [255, 255, 255] },
            alternateRowStyles: { fillColor: [240, 240, 240] },
            headStyles: { fillColor: [3, 187, 133], halign: 'center' },
            didDrawPage: function(data) {
                // Configurações adicionais podem ser feitas aqui
            },
        });
      
        // Salvar o PDF
        doc.save('evaluation-table.pdf');
      };

  const handleDownloadPdf = async (matricula) => {
    try {
      const ano = formik.values.ano.split(' - ')[1]; // Obtém o segundo valor do intervalo
      const response = await axios.get(`${API_BASE_URL}/servidor/${matricula}/${ano}`);
      const evaluationData = response.data;
    
      downloadPdfDocumentWithText(evaluationData);
    } catch (error) {
      console.error('Erro ao baixar o PDF:', error);
    }
  };
      
/* -------- Formik --------- */

  const formik = useFormik({
    initialValues: {
      ano: '',
      nome: ''
    },
    validationSchema: Yup.object({
      ano: Yup.string().required('Ano é obrigatório'),
      nome: Yup.string(),
    }),
    onSubmit: async (values, { setSubmitting }) => {
      try {
        const ano = values.ano.split(' - ')[1]; // Obtém o segundo valor do intervalo
        const response = await axios.get(`${API_BASE_URL}/avaliacoes_acordo/`, {
          params: {
            ano: ano,
            nome: values.nome
          }
        });
        setResultados(response.data);
      } catch (error) {
        console.error('Houve um erro ao buscar os servidores:', error);
      } finally {
        setSubmitting(false);
      }
    },
  });

  const formik2 = useFormik({
    initialValues: {
      ano: '',
      nome: ''
    },
    validationSchema: Yup.object({
      ano: Yup.string().required('Ano é obrigatório'),
      nome: Yup.string(),
    }),
    onSubmit: async (values, { setSubmitting }) => {
      try {
        const response = await axios.get(`${API_BASE_URL}/avaliacoes_acordo/`, {
          params: {
            ano: values.ano,
            nome: values.nome
          }
        });
        setResultados(response.data);
      } catch (error) {
        console.error('Houve um erro ao buscar os servidores:', error);
      } finally {
        setSubmitting(false);
      }
    },
  });

    const intervalOptions = [
      '2023 - 2024', 
      '2024 - 2025', 
      '2025 - 2026', 
      '2026 - 2027', 
      '2027 - 2028'
    ];

    const handleSelectChange2 = (e) => {
      const selectedInterval = e.target.value;
      formik.setFieldValue('ano', selectedInterval);
    };

    const formatDate = (dateString) => {
      const [year, month, day] = dateString.split('-');
      return `${day}/${month}/${year}`;
    };

  return (
    <div className={styles.avaliacao_container1}>
      <div className={styles.avaliacao_container}>
        <h1>Resumo das avaliações de sua lotação</h1>
        <form className={styles.form_control} onSubmit={formik.handleSubmit}>
          <div className={styles.formik_pesquisa}>
          
              <select
                className={styles.selectservidor}
                name="ano"
                onChange={handleSelectChange2}
                value={formik.values.ano} // Agora é o intervalo completo
              >
                <option value="" disabled>Selecione um ano</option>
                {intervalOptions.map((option) => (
                  <option key={option} value={option}>
                    {option}
                  </option>
                ))}
              </select>
            
            <input
              type="text"
              className={styles.selectservidor3}
              name="nome"
              placeholder="Digite o nome do servidor"
              onChange={formik.handleChange}
              value={formik.values.nome}
            />

          </div>
          <button className={styles.botaoservidor2} type="submit" disabled={formik.isSubmitting}>
            Pesquisar
          </button>
        </form>
      </div>

        <div className={styles.tableContainer2}>
          {resultados.length > 0 && (
            <table>
              <thead>
                <tr>
                  <th>Nome</th>
                  <th>Ações</th>
                </tr>
              </thead>
              <tbody>
                {resultados.map((servidor, index) => (
                  <tr key={index}>
                    <td>{servidor.avaliado}</td>
                    <td>
                      <button onClick={() => handleDownloadPdf(servidor.avaliado_matricula)}>
                        Baixar PDF
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>
    </div>
  );
}

export default Perfil